import "./App.css";

function App() {
  const name = "Harshal Rajendra Sonawane";
  const liker = 50;
  const obj = { name: harshal };
  return (
    <div className="App">
      <div className="content"></div>
      <h1>{name}</h1>
      <p>Harshal likes {liker} times.</p>
      <p>{obj}</p>
    </div>
  );
}

export default App;
